import json
import numpy as np

def convert_to_desired_format(original_data):
    converted = {"idpt": {}}
    
    for model_id, model_data in original_data["idpt"].items():
        # Extraer solo los valores numéricos de 'idpt' y convertir a float nativo
        converted_values = [
            float(value) 
            for value in model_data["idpt"]
        ]
        converted["idpt"][model_id] = converted_values
    
    return converted

